 u mtacoxutyun@</li>\n<li>erevakayutyun@</li>\n<li>chanachoxakan hetaqrqrutyun@</li>\n</ul>\n<p>&nbsp;</p>\n<ul>\n<li>Erkarutyun@՝ 16 sm</li>\n<li>Laynutyun@՝ 22sm</li>\n<li>Bardzrutyun@՝ 17sm</li>\n<li>1+ tari</li>\n</ul>','',0),(748,'1444',0,1615,1900,11,'2015-07-18 12:21:09','2015-07-18 12:21:09',1,9,'Meqena \"Bublik\"  3 hat','<p>Poqr ays xaxaliqner@ naxatesvac en &nbsp;amenapoqreri hamar։ Orakyal plastikayov e patrastvac, isk hacheli, var guynerov &nbsp;el &nbsp;kgravi&nbsp;&nbsp;erexayi ushadrutyun@։</p>\n<ul>\n<li>Nyut@՝plastik</li>\n<li>Chap@ mi meqenayi՝ 7.5 sm</li>\n<li>Mi havaqacuyyum՝ mardatar meqena, bernatar, &nbsp;sanduxqov meqena</li>\n<li>3+ tari</li>\n</ul>','',0),(749,'1508',0,1425,1650,11,'2015-07-18 12:52:23','2015-07-18 12:58:10',1,9,'\"Zvarchali\" burg','<p>Lav xaxaliq e xaxalu avazot vayrerum ev,&nbsp;parzapes, loxanalu jamanak։<br />Naxatesvac &nbsp;e sovorecnelu erexayin, orpeszi tarberaki obyektneri dzev@ ev chap@, guyner@։</p>\n<p>Burg@ karox en havaqel &nbsp;bajaki nersi ev drsi koxmerov։<br /><br /></p>\n<ul>\n<li>Nyut@՝ plastik</li>\n<li>Bardzrutyun@ xoshor bajaki՝ 5 sm,tramagic@՝&nbsp; 6 sm</li>\n<li>Bardzrutyun@ &nbsp;poqr bajaki՝ 4 sm, tramagic@՝ 5 sm</li>\n<li>Tariq@՝ 1+ tari</li>\n</ul>','https //www.youtube.com/watch?v=qJ8Ng9JPwSY#acti',0),(750,'1511',0,1425,1425,11,'2015-07-18 13:15:39','2015-07-18 14:04:06',1,9,'Zvarchali burg- 2','<p>Burg@ naxagcvac e aynpes, or ayn karoxanan havaqel ev՛ verin koxmov ev՛ &nbsp;nersi։ Havaqacun nerarum e 8 bajak՝ &nbsp;dexin, narnjaguyn, karmir, vardaguyn, kapuyt, bac kapuyt, mug kanach &nbsp;ev bac kanach guynerov։</p>\n<p>Xaxum erexan karox e sovorel tarberel guyner@, tarberakel dzever@, oroshel chap@։</p>\n<p>Gavatnerov karox en havaqvel mi sharq dzever՝ &nbsp;tner ev burger։</p>\n<ul>\n<li>Nyut@՝ bardzr oraki plastik</li>\n<li>Tariq@՝ 3+ tari</li>\n</ul>','',0),(751,'1512',0,3135,3650,11,'2015-07-18 13:53:22','2015-07-18 13:53:22',1,9,'Zvarchali \"Mec burg\"','<p>Ays &nbsp;burgi &nbsp;norut