xni antarber dzer erexayin ev &nbsp;tuyl chi ta, or na dzandzrana։ Chxkchxkan@ e matani e , ori vra kaxvac en &nbsp;ereq gunagex poqr xaxaliqner։ &nbsp;Harmaravet dzev@ tuyl e talis, or erexan &nbsp;brni ayn։ &nbsp;</p>\n<ul>\n<li>Tramagic@ ՝ 8 sm</li>\n<li>Tariq@՝ 0+ amis</li>\n</ul>','',0),(756,'1535',0,1568,1850,11,'2015-07-18 15:17:29','2015-07-18 15:17:29',1,9,'Chxchxkan  \"Gnacqik\"','<p>Urax \"gnacq\" chxchxkan@ &nbsp; bajanvum e mi qani xoshor maseri, inchpisin e legon։</p>\n<ul>\n<li>Patetavormamb</li>\n<li>Chap@՝ 12 x 10 x 10 sm</li>\n<li>Tariq@՝ 0 + tari</li>\n</ul>','',0),(757,'1537',0,950,1100,11,'2015-07-18 15:40:53','2015-07-18 15:40:53',1,9,'Chxchxkan \" Caxracu\"','<p>Chxchxkan \" Caxracun\"&nbsp;kogni dzez shexel erexayi ushadrutyun@ depi dzez։ Chxchxkan@ npastum e mankakan dzerqi sharjumneri zargacman@, shoshapeli ev dzaynayin @nkalman@ ev uni harmaravet &nbsp;dzev։</p>\n<ul>\n<li>Nyut@՝ plastik</li>\n<li>Chap@՝ 10.5 sm</li>\n<li>Tariq@՝ 1+ amis</li>\n</ul>','',0),(758,'1539',0,760,900,11,'2015-07-18 16:00:02','2015-07-18 16:00:02',1,9,'Chxchxkan  \"Akrobat\"','<p>&laquo;Akrobat@&raquo; chi toxni antarber dzer erexayin &nbsp;ev &nbsp;tuyl chi ta, or na dzandzrana։ Xaxaliq@ &nbsp;zvarchali poqrik kendaniner e nerkayacnum՝ &nbsp;mi punj gunavor gndaknerov, oronq handes en galis orpes chxchxkanner։ Harmaravet e, &nbsp;var guynern el uxxvac en &nbsp;hogekan gorcuneutyan&nbsp;zargacman@, guyni @nkalman, erexayi dzerqi shoshapeli ev nurb sharjoxakan hmtutyunneri ev &nbsp;lsoxutyan zargacman@։&nbsp;</p>\n<ul>\n<li>Erkarutyun@՝ 12.5 sm</li>\n<li>Tariq@՝ &nbsp;0+ amis</li>\n</ul>','',0),(759,'1540',0,618,750,11,'2015-07-18 17:14:59','2015-07-18 17:14:59',1,9,'Chxchxkan  \"Shxta\"','<p>Chxchxkan &nbsp;\"Shxtan\"&nbsp;kazmvac &nbsp;e tarber guyneri arandzin ktorneric։ Yuraqanchyurn el uni &nbsp;konkret erkrachapakan dzev։</p>\n<p>Plastik dzoxeri hastutyun@ 5 mm, makeresin uni &nbsp;oroshaki @ndgcumner naev karox eq dzgel ayn։</p>\n<ul>\n<li>Tramagic@՝ 5.5 sm