>\n</ul>','',0),(831,'6140',0,4350,5000,4,'2015-07-23 16:02:40','2015-07-23 16:02:40',1,5,'Loganqi xaxaliq «Aybbenaran»','<p>Nerkayacvac e tarer ev tver loganqi hamar։&nbsp;</p>\n<p>Nkaragrutyun՝</p>\n<ul>\n<li>Sovorel ev xaxal, unenal zvarchanali jamanak &nbsp;logaranum</li>\n<li>Tarer@ &nbsp;ev tver@ duq karox eq pakcnel patin salikneri vra</li>\n</ul>\n<ul>\n<li>26 tarer (A-Z) ev 10 hamarner (0-9)</li>\n<li>Tac tarer@ ev tver@ kpchum en baxniqi patin</li>\n<li>Prpur@ &nbsp;e papuk e, erkaratev ev och tunavor</li>\n</ul>','',0),(832,'6142',0,3306,3800,4,'2015-07-23 17:57:35','2015-07-23 17:57:35',1,5,'Loganqi xaxaliqner','<p><strong></strong>Duq sovor eq, or ayjm amen inch erexaner@ tanum en depi &nbsp;beran@։ &nbsp;Cnoxner@ karox en miayn mi shat karevor ban hashvi arnel, &nbsp;or xaxaliqner@, oronq @nknum en erexayi beran@, naxatesvac linen ayd npataki hamar։ Orinak, dzknorsutyun xax@ logaranum, zargacnum e nurb sharjakan hmtutyunner@, baci ayd՝ patrastvac e och tunavor erkarajamket ogtagorcman entaka nyuterov։</p>\n<p>Isk ays xaxum ka &nbsp;intensiv zargacman karevor hmtutyunner &nbsp;evs՝</p>\n<ul>\n<li>sharjakan hmtutyunner@ ev &nbsp;sharjumneri hamakargum@, aynqan el hesht che brnel covayin araracnerin, nranq an@ndhat loxum en։</li>\n<li>guyni @nkalum@, bolor &nbsp;xaxaliqner@ tarber guyneri en՝ &nbsp;kareli e tal erexayin xndir՝ &nbsp; brnel &nbsp;orinak, karmir kendanun ev tesnel, te ov e։</li>\n<li>hashvel, &nbsp;mi moraceq uraxanal miasin, hashvelov, te qani &laquo;dzuk&raquo; e brnel։</li>\n<li>Nerarum e՝ &nbsp;utotnuk, kria ev dzuk</li>\n<li>Tariq@՝ &nbsp;18 + amis</li>\n</ul>','',0),(833,'5436',0,4002,4600,4,'2015-07-23 18:15:51','2015-07-23 18:15:51',1,5,'«GARDEN FRESH» mrgeri u banjarexeni  hamar','<p>Idealakan e Dzer erexayi hamar sousnerov pyure patrastelu&nbsp;hamar։</p>\n<ul>\n<li>Manracnum e mirgn u banjarexen@</li>\n<li>Nerarum poxarineli cancer՝ mec ancqerov ev &nbsp;poqr ancqerov</li>\n<li>Ayn chi parunakum (BPA)</li>\n</ul>','',0),(834,'5434',0,3306,3800,4,'2015-07-23 18:28:54','2015-07-23 18:28:54',1,5,'Kaparichov xcik snund pahelu hamar','<p>Nor dzevov &nbsp;Nuby-i aman@ naxatesvac e sarecman hamar, orpeszi pahpanel tan@ epac snnund@ shat hesht ev parz mijocov։ Taroxutyun@՝ 45ml e։ Kareli e pahel sarnaranum ՝ anvtang ev &nbsp;maqur։</p>\n<ul>\n<li>Anvtang, erkarakyac ev bazmaki kirarman plastika</li>\n<li>Tarm patrastvac uteliqi pahestavorman kam sarecman hamar</li>\n<li>kaparichov</li>\n</ul>','',0),(835,'6137',0,6090,7000,4,'2015-07-23 18:44:58','2015-07-23 18:51:47',1,5,'Loganqi \"Ket\"  xaxaliq-tarra','<p>Nuby nerkayacnum e &nbsp;\"Ket\"&nbsp;tarran՝&nbsp;</p>\n<ul>\n<li>amracvum e patin</li>\n<li>@ndardzak e</li>\n</ul>\n<p>Nuby &nbsp;\"Ket\"-@ &nbsp;&nbsp;&nbsp;shat hesht&nbsp;havaqum e &nbsp;xaxaliqner@ loganqic heto։ Ayn uni hatuk ancqer, ortexic &nbsp;jrur@ tapvum e ev &nbsp;xaxaliqner@ &nbsp;arag choranum en։ Havaqacuyum ka &nbsp;patin pakcvox mi amrak, or@ shat hesht e texadrvum։</p>','',0),(836,'4755',0,2175,2500,4,'2015-07-24 14:47:10','2015-07-27 08:56:06',1,5,'Patkerazard papuk girq','<p>Papuk ev &nbsp;chkun &nbsp;grqi ays ejer@ chen qorum &nbsp;kam vnasum erexayi nurb mashk@։ Dranq naev shat hesht en &nbsp;maqrvum։ &nbsp;Grqi yuraqanchyur var patker kgravi erexayi ushadrutyun@։ Nayelov patkernerin, &nbsp;erexan canotanum e ditman dzeverin։ Ayspisov, nerkaycvac e zvarchali girq։</p>\n<ul>\n<li>Nyut@՝ &nbsp;japaven</li>\n<li>Tariq@՝ 6+ amis</li>\n</ul>','',0),(837,'5383',0,1479,1700,4,'2015-07-24 15:13:56','2015-07-24 15:13:56',1,5,'Kerakrman  papuk, guynzguyn gdal','<p>Ays gdali nor ev var dizayn@ kgravi erexayi&nbsp;ushadrutyun@ &nbsp;kerakrman&nbsp;jamanak։ Ayn apahovum e harmaravetutyan&nbsp;&nbsp;kerakrman @ntacqum։</p>\n<p>Anhrajesht e lvanal &nbsp;minchev arajin ogtagorcum@ ev &nbsp;heto՝ yuraqanchyur hajord ogtagorcman hamar։ Lvanal taq &nbsp;ochari&nbsp;jrov, &nbsp;apa manrakrkit lvanal ayn sar@ jri tak։ Artadranq@ karox e lvacvel spasq lvacox meqenayov։&nbsp;</p>\n<p>Zgushacum՝&nbsp;</p>\n<p>Misht stugeq snndi jermastichan@ minchev kerakrel@։ Ays &nbsp;artadranq@ patrastvum e anvtang, amur, och tunavor nyuteric:</p>','',0),(838,'5256',0,1131,1300,4,'2015-07-24 15:46:25','2015-07-24 15:46:25',1,5,'Gdal ev pataraqax','<p>Erb erexan arden sovorecrel e iren tanel gdaln ir beran@, apa jamanakn e araj sharjvel depi hajord pul։ &nbsp;Var, usucoxakan ays gdaln u pataraqax@ patrastvum en anvtang, erkbaxadrich plastikayic ev papuk nyutic, or@ chi karox vnasel &nbsp;erexayin։ Anhrajesht e, or irenq karoxacel en ogtagorcel hamapatasxan gorciqner@: Karevor e hishel, or utestneri hamar erexanerin petq e och miayn apahov, ayl naev &nbsp;hatuk naxatesvac lini aynpes, or erexayin harmar lini &nbsp;ogtagorcel ayn:</p>\n<p>Nuynqan harmar e ogtagorcel naev aj ev dzax dzerqerov։</p>\n<p>Aravelutyunner@՝</p>\n<ul>\n<li>hatuk naxatesvac en mankakan dzerqeri hamar</li>\n<li>brnaki makerevuyti yurahatuk linel@&nbsp;</li>\n<li>erexayi ankaxutyan mijoc e</li>\n</ul>','',0),(839,'22012',0,1392,1600,4,'2015-07-24 16:09:26','2015-07-24 19:57:26',1,5,'Gdal ev pataraqax \" FLOWER\"','<p>Erb erexaner@ sksum en cuyc tal &nbsp;hetaqrqrutyun depi &nbsp;inqnuruyn utel@, duq parzapes petq e ogneq nranc։ Anhrajesht e, or erexan unena aynpisi spasq, or &nbsp; bacardzak anvtang e inqnuruyn kerakrvelu hamar։ &nbsp;</p>\n<p>Ays artadranq@ &nbsp;shat hesht e brnel &nbsp; aj , aynpes el dzax dzorqov։ Ayn &nbsp;hatuk naxagcvac e kor dzevov, or &nbsp;erexaner@ &nbsp;sirov u hetaqrqrutyamb en &nbsp;pordzum inqnuruyn &nbsp;pahel &nbsp;irenc dzerqum։</p>\n<p>Anhrajesht e՝</p>\n<p>lvanal &nbsp;arajin ogtagorcman depqum՝ &nbsp;taq &nbsp;ochari&nbsp;jrov , apa maqur jrov։ Ayn anvtang e naev &nbsp;spasq lvacox meqenayov lvanalu hamar;</p>\n<ul>\n<li>Artadranq@ patrastvum &nbsp;e anvtang, amur, och tunavor nyuteric:</li>\n</ul>','',0),(840,'22010',0,1392,1600,4,'2015-07-24 16:41:13','2015-07-24 16:41:13',1,5,'Gdal ev pataraqax \"Hresh\"','<p>Nuby Gdal ev pataraqax@ &nbsp;&nbsp;\"Hresh\" &nb